                "phpcs": [
                    "PWD=$(pwd) && phpcs --runtime-set ignore_warnings_on_exit 1 --runtime-set ignore_errors_on_exit 1 --ignore=$PWD/web/,$PWD/vendor/"
                ],
                "lint": [
                    "parallel-lint --exclude web --exclude vendor ."
                ],
                "runserver": [
                    "drush runserver 0.0.0.0"
                ],
                "chromedriver": [
                    "chromedriver --port=9515 --verbose --whitelisted-ips --log-path=/tmp/chromedriver.log --no-sandbox"
                ],
                "create-symlinks": [
                    "cd web/modules/project && find ../../.. -maxdepth 1 ! -name .git ! -name web ! -name vendor -print | while read file; do ln -s $file .; done"
                ],
                "unit": [
                    "phpunit --verbose web/modules/project"
                ],
                "phpstan": [
                    "phpstan analyse web/modules/project"
                ],
                "post-update-cmd": [
